{
  "translationLines": [
    {
      "lineNumber": 132711,
      "originalJapaneseLine": "　命を捨てるものと――」",
      "translatedEnglishLine": "\"Those who are willing to throw away their lives――\""
    },
    {
      "lineNumber": 132712,
      "originalJapaneseLine": "「その声はイージスか！」",
      "translatedEnglishLine": "\"Is that voice Aegis!\""
    },
    {
      "lineNumber": 132713,
      "originalJapaneseLine": "「……む、お前は」",
      "translatedEnglishLine": "\"...Hmm, you are\""
    },
    {
      "lineNumber": 132714,
      "originalJapaneseLine": "木々の枝の上にいたイージスと、",
      "translatedEnglishLine": "Aegis, who was on the branches of the trees,"
    },
    {
      "lineNumber": 132715,
      "originalJapaneseLine": "イージスの部下であるカラーの兵が",
      "translatedEnglishLine": "and the soldiers of Color, Aegis's subordinates,"
    },
    {
      "lineNumber": 132716,
      "originalJapaneseLine": "上から降ってきた。",
      "translatedEnglishLine": "fell down from above."
    },
    {
      "lineNumber": 132717,
      "originalJapaneseLine": "「ランス、か……」",
      "translatedEnglishLine": "\"Rance, huh...\""
    },
    {
      "lineNumber": 132718,
      "originalJapaneseLine": "「ねえねえ、あれってもしかして……」",
      "translatedEnglishLine": "\"Hey hey, isn't that possibly...\""
    },
    {
      "lineNumber": 132719,
      "originalJapaneseLine": "「ほら、あれ、ランスさんよ。",
      "translatedEnglishLine": "\"Look, that's Rance-san."
    },
    {
      "lineNumber": 132720,
      "originalJapaneseLine": "　リセット様のお父様の」",
      "translatedEnglishLine": "The father of Lady Reset.\""
    },
    {
      "lineNumber": 132721,
      "originalJapaneseLine": "「きゃーっ、私、この目で見るの初めて！」",
      "translatedEnglishLine": "\"Kyaa, this is the first time I've seen him with my own eyes!\""
    },
    {
      "lineNumber": 132722,
      "originalJapaneseLine": "後ろの方ではしゃぐカラーの娘達を制して、",
      "translatedEnglishLine": "Holding back the excited girls of Color behind,"
    },
    {
      "lineNumber": 132723,
      "originalJapaneseLine": "イージスが一歩前に出る。",
      "translatedEnglishLine": "Aegis stepped forward."
    },
    {
      "lineNumber": 132724,
      "originalJapaneseLine": "「ランス、どうしてここに？」",
      "translatedEnglishLine": "\"Rance, what are you doing here?\""
    },
    {
      "lineNumber": 132725,
      "originalJapaneseLine": "「カラーの村が魔軍に襲われてると聞いてな。",
      "translatedEnglishLine": "\"I heard the village of Color was attacked by the demon army."
    },
    {
      "lineNumber": 132726,
      "originalJapaneseLine": "　助けに来てやったぞ」",
      "translatedEnglishLine": "I came to help.\""
    },
    {
      "lineNumber": 132727,
      "originalJapaneseLine": "「そうか……",
      "translatedEnglishLine": "\"Is that so...\""
    },
    {
      "lineNumber": 132728,
      "originalJapaneseLine": "　正直、助かる……」",
      "translatedEnglishLine": "To be honest, that’s a relief...\""
    },
    {
      "lineNumber": 132729,
      "originalJapaneseLine": "「がははははははははは！",
      "translatedEnglishLine": "\"Gahahahahahaha!"
    },
    {
      "lineNumber": 132730,
      "originalJapaneseLine": "　恋人のピンチとあっては当然だ！」",
      "translatedEnglishLine": "Of course, when my lover’s in trouble!\""
    },
    {
      "lineNumber": 132731,
      "originalJapaneseLine": "「え？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 132732,
      "originalJapaneseLine": "「えーーーっ、恋人！？」",
      "translatedEnglishLine": "\"Ehhh, lover!?\""
    },
    {
      "lineNumber": 132733,
      "originalJapaneseLine": "「ん？　そちらのピンク色の女性は……」",
      "translatedEnglishLine": "\"Hmm? That pink-colored woman over there is...\""
    },
    {
      "lineNumber": 132734,
      "originalJapaneseLine": "「そうか、会うのは初めてか。",
      "translatedEnglishLine": "\"I see, this is the first time you’re meeting."
    },
    {
      "lineNumber": 132735,
      "originalJapaneseLine": "　イージス、こいつはシィルだ」",
      "translatedEnglishLine": "Aegis, this is Sil.\""
    },
    {
      "lineNumber": 132736,
      "originalJapaneseLine": "「ああ、ランス城の氷の中にいた、",
      "translatedEnglishLine": "\"Ah, she was inside the ice of Rance Castle,"
    },
    {
      "lineNumber": 132737,
      "originalJapaneseLine": "　ランスの奴隷だな。",
      "translatedEnglishLine": "Rance’s slave."
    },
    {
      "lineNumber": 132738,
      "originalJapaneseLine": "　見覚えはあったんだ……」",
      "translatedEnglishLine": "I recognized her...\""
    },
    {
      "lineNumber": 132739,
      "originalJapaneseLine": "「イージス・カラーだ。",
      "translatedEnglishLine": "\"I am Aegis Color."
    },
    {
      "lineNumber": 132740,
      "originalJapaneseLine": "　カラーの村、防衛隊長兼",
      "translatedEnglishLine": "Captain of the defense of the Village of Color and"
    },
    {
      "lineNumber": 132741,
      "originalJapaneseLine": "　ランスの恋人をしている」",
      "translatedEnglishLine": "Rance’s lover.\""
    },
    {
      "lineNumber": 132742,
      "originalJapaneseLine": "「こ、恋人って……本当ですか……？」",
      "translatedEnglishLine": "\"L-lover... is that true...?\""
    },
    {
      "lineNumber": 132743,
      "originalJapaneseLine": "「くっくっくっ……」",
      "translatedEnglishLine": "\"Heh heh heh...\""
    },
    {
      "lineNumber": 132744,
      "originalJapaneseLine": "（あ、そのお顔は、やっぱり嘘なんですね！？）",
      "translatedEnglishLine": "(Ah, that expression means it’s a lie, isn’t it!?)"
    },
    {
      "lineNumber": 132745,
      "originalJapaneseLine": "シィルがパパパッと身振り手振りで聞く。",
      "translatedEnglishLine": "Sil quickly asked with gestures."
    },
    {
      "lineNumber": 132746,
      "originalJapaneseLine": "（当然だ、アホめ。",
      "translatedEnglishLine": "(Of course, you fool."
    },
    {
      "lineNumber": 132747,
      "originalJapaneseLine": "　以前こいつが記憶喪失になったときに、",
      "translatedEnglishLine": "When this guy lost his memory before,"
    },
    {
      "lineNumber": 132748,
      "originalJapaneseLine": "　恋人同士だったという嘘をついたのだ）",
      "translatedEnglishLine": "I told the lie that we were lovers.)"
    },
    {
      "lineNumber": 132749,
      "originalJapaneseLine": "ランスもパパパッと身振り手振りで答える。",
      "translatedEnglishLine": "Rance quickly responded with gestures too."
    },
    {
      "lineNumber": 132750,
      "originalJapaneseLine": "（それまでバリバリの敵だったのに、",
      "translatedEnglishLine": "(Even though she was a fierce enemy until then,"
    },
    {
      "lineNumber": 132751,
      "originalJapaneseLine": "　アッサリと信じて可愛い奴なのだ、がははは！）",
      "translatedEnglishLine": "she easily believed it, what a cute fool, gahahaha!)"
    },
    {
      "lineNumber": 132752,
      "originalJapaneseLine": "（えーーーっ、そんなぁ、可哀相ですよ。",
      "translatedEnglishLine": "(Ehhh, that’s awful, how pitiful."
    },
    {
      "lineNumber": 132753,
      "originalJapaneseLine": "　誤解を解きましょうよぉ）",
      "translatedEnglishLine": "Let’s clear up the misunderstanding.)"
    },
    {
      "lineNumber": 132754,
      "originalJapaneseLine": "（アホか、余計なことを言うなよ。",
      "translatedEnglishLine": "(Are you stupid? Don’t say unnecessary things."
    },
    {
      "lineNumber": 132755,
      "originalJapaneseLine": "　もしも言ったら、こんなことするぞ、",
      "translatedEnglishLine": "If you say something, I’ll do this,"
    },
    {
      "lineNumber": 132756,
      "originalJapaneseLine": "　それからあんなことまでするぞ）",
      "translatedEnglishLine": "and even do that.)"
    },
    {
      "lineNumber": 132757,
      "originalJapaneseLine": "（こんなことってなんですかぁ……",
      "translatedEnglishLine": "(W-what kind of things are those...?"
    },
    {
      "lineNumber": 132758,
      "originalJapaneseLine": "　うう、痛いの嫌ですよ……ひんひんっ……）",
      "translatedEnglishLine": "Ugh, I hate pain... sniff sniff...)"
    },
    {
      "lineNumber": 132759,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "\"........................\""
    },
    {
      "lineNumber": 132760,
      "originalJapaneseLine": "「はぁ……差を実感してへこむなぁ……",
      "translatedEnglishLine": "\"Haa... Feeling the difference really gets me down...\""
    }
  ]
}

